Actionscript.script:
function 长棍攻击(击倒率, 倍率)
{
	倍率 = 倍率? 倍率 : 1.5;
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 倍率;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 击倒率;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}
function 长棍旋击(击倒率)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 0.2;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	子弹参数.霰弹值 = 3;
	子弹参数.子弹种类 = "近战联弹";
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 击倒率;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}

onClipEvent(enterFrame){
   _parent.攻击时可斜向改变移动方向(5,10);
}

